inline uintptr_t ResNet50_PostProcess(std::vector<tensorflow::Tensor>& outputs, std::vector<QuerySample>& queries, uintptr_t post_out_ptr, size_t& calc_out_size) {
  // Resnet post-processing (subtract 1)
  const int64_t offset = -1;
  size_t out_size = 0;
  for(auto out : outputs) {
    for(int i = 0; i < out.NumElements(); i++) {
      out.vec<int64>()(i) += offset;
    }
    out_size += out.TotalBytes();
  }
  calc_out_size = out_size;
  return reinterpret_cast<uintptr_t>(outputs[0].tensor_data().data());
}

inline uintptr_t SSDMobileNetV1_PostProcess(std::vector<tensorflow::Tensor>& outputs, std::vector<QuerySample>& queries, uintptr_t post_out_ptr, size_t& calc_out_size) {
  // SSD post-processing (rearrange data to expected format)
  float* scratch_area = (float*)post_out_ptr;
  const float offset = 1.0;

  float* detection_boxes = outputs[0].flat<float>().data();
  float* detection_classes = outputs[1].flat<float>().data();
  float* detection_scores = outputs[2].flat<float>().data();
  float num_detections = outputs[3].flat<float>().data()[0];

  for (int64_t q = 0; q < queries.size(); ++q) {
    int64_t q_id = queries[q].index;

    size_t cur_idx = 0;
    size_t box_idx = 0;
    size_t class_idx = 0;
    size_t score_idx = 0;
    for(int i = 0; i < num_detections; i++) {
      scratch_area[cur_idx++] = float(q_id);
      scratch_area[cur_idx++] = detection_boxes[box_idx++];
      scratch_area[cur_idx++] = detection_boxes[box_idx++];
      scratch_area[cur_idx++] = detection_boxes[box_idx++];
      scratch_area[cur_idx++] = detection_boxes[box_idx++];
      scratch_area[cur_idx++] = detection_scores[score_idx++];
      scratch_area[cur_idx++] = detection_classes[class_idx++] + offset;
    }

    calc_out_size = cur_idx*sizeof(float);
  }

  return post_out_ptr;
}

